import styled from "styled-components";

const LoginBoxPresenter = styled.div`
    display:flex;
    align-items: center;
    justify-content: center;
    width:500px;
    height:400px;
    border-radius:50px;
    background-color:white;
    box-shadow: 0px 0px 100px black;
`

export default LoginBoxPresenter;
